    }
    const pageCount=500;
    return(
    
     
      <ReactPaginate
        breakLabel="..."
        nextLabel="التالى >"
        onPageChange={handlePageClick}
        pageRangeDisplayed={5}
        pageCount={pageCount}
        previousLabel="< السابق"
        renderOnZeroPageCount={null}
      />
    
    )
}
export default Pagenation;
